import React,{useState} from "react";
import axios from "axios";
function Contact() {
  

const [user,setUser]=useState({
name:"",
email:"",
query:""
});

function handleChange(event)
{
  const {name,value}=event.target
  setUser({
    ...user,
    [name]:value
  })
}

function handleClick(){
  const {name,email,query} =user
  axios.post("localhost:9002/register",user)
  .then(res=> console.log(res))
}

return (
    <div>
      <h1 className="text-center">Contact us</h1>
      <div className="form1 container">
        <div className="row">
          <div className="col-md-6 col-10 mx-auto">
            <form>
              <div class="form-group">
                <label>Name</label>
                <input
                  type="text"
                  name="name"
                  value={user.name}
                  class="form-control"
                  placeholder="Name"
                  onChange={handleChange}
                />
                <label for="exampleInputEmail1">Email address</label>
                <input
                  type="email"
                  class="form-control"
                  name="email"
                  value={user.email}
                  id="exampleInputEmail1"
                  aria-describedby="emailHelp"
                  placeholder="Enter email"
                  onChange={handleChange}
                />
                <label>Your Query</label>
                <textarea
                  class="form-control"
                  name="query"
                  value={user.query}
                  cols="100"
                  rows="5"
                  placeholder="Query"
                  onChange={handleChange}
                ></textarea>
              </div>
              <button type="submit" class="btn btn-primary last" onClick={handleClick}>
                Submit
              </button>
            </form>
          </div>
        </div>
        <footer className="foot text-center">
          <p>Â© Copyright 2022 Clubs United</p>
          <p>
            Made with <i class="fa-solid fa-heart"></i> by Gaurav Ahuja
          </p>
        </footer>
      </div>
    </div>
  );
}
export default Contact;
